import { Row } from "antd";
import React, { Component } from "react";

import { render } from "react-dom";
import { withTranslation } from "react-i18next";
import RoadmapContentBlock from "../ContentBlock/RoadmapContentBlock";

import {
  GenContainer,
  BlockContainer,
  ContentWrapperTitle,
  FaqContainer,
  FaqContent,
  FaqContentWrapper,
} from "./styles";

const Faq = () => {

  return (
    <GenContainer>
      <BlockContainer>
          <Row justify="center" align="middle">
            <ContentWrapperTitle>
                <h1>FAQ</h1>
            </ContentWrapperTitle>
          </Row>


          <FaqContainer>
              <FaqContentWrapper>
                <h6>Test</h6>
              </FaqContentWrapper>
          </FaqContainer>
          
          <FaqContainer>
              <FaqContentWrapper>
                <h6>Test</h6>
              </FaqContentWrapper>
          </FaqContainer>

      </BlockContainer>
    </GenContainer>
  );
};

export default withTranslation()(Faq);
